function splitUnit(val) {
  var ret = {
    number: 0,
    unit: null
  };
  var test = val.match(/([-0-9\\.]+)($|[a-z%]+)/);
  if (typeof(val) == 'number')
    ret.number = val;
  else if (test != null && test[1] != undefined) {
    ret.number = test[1];
    ret.unit = test[2];
  } 
  else return false;
  return ret;
}
/* ------------------------------------------------
 * 変数
 */
var normal_speed = 'normal';
var fast_speed = 'fast';
var disc = {
  current: '',
  isShowDetail: false,
};
/* ------------------------------------------------
 * ディスク詳細
 */
disc.details = {
  items: {},
  changeItem: function (label) {
    var that = this;
    if (disc.isShowDetail) {
      $(this.items[disc.current]).fadeTo(fast_speed, 0, function () {
        $(that.items[label]).fadeTo(fast_speed, 1);
      });
    }
  },
  show: function (fn) {
    var fn = fn || function () {};
    $(this.container).show();
    $(this.closer).fadeTo(normal_speed, 0.5);
    $(this.items[disc.current]).fadeTo(normal_speed, 1, fn);
  },
  hide: function (fn) {
    var fn = fn || function () {};
    $(this.container).hide();
    $(this.closer).fadeTo(normal_speed, 0);
    $(this.items[disc.current]).fadeTo(normal_speed, 0, fn);
  },
  init: function () {
    var that = this;
    this.container = $('#discDetails')[0];
    this.closer = $('.close', this.container)[0];
    $(this.container).find('.detail').each(function () {
      var label = $(this).attr('id');
      that.items[label] = this;
    });
    $(this.closer)
      .click(function () { disc.hideDetail(); })
      .hover(function () {
        $(this).fadeTo(normal_speed, 1);
      }, function () {
        $(this).fadeTo(normal_speed, 0.5);
      });
  },
};

/* ------------------------------------------------
 * 音楽プレーヤー
 */
disc.player = {
  play: function () { 
  },
  init: function () {
    var that = this;
    this.icon = $('#playIcon').hover(function () {
      $(this).stop().fadeTo(normal_speed, 0.5);
    }, function () {
      $(this).stop().fadeTo(normal_speed, 0);
    }).click(function () {
      that.play();
    })[0];
  }
};

/* ------------------------------------------------
 * カバーフロー
 */
disc.flow = new ContentFlow('DiscFlow', {
  reflectionHeight: 0, // 画像下の反射の有無
  circularFlow: false, // コレクションをループさせるか
  startItem: 0, // コレクションの開始インデックス
  scrollWheelSpeed: 0, // マウスホイールのスピードコントロール
  scaleFactorLandscape: 'max',
  onclickActiveItem: function () { disc.showDetail(); },
  onMoveTo: function (item) {
    var label = $(item.element).attr('label');
    disc.details.changeItem(label);
    if (disc.isShowDetail) {
      $(this.getItem(disc.currentIndex).element)
        .fadeTo(fast_speed, disc.flow.inactiveOpacity, function () {
          $(item.element).fadeTo(fast_speed, 1);
        });
      $(disc.player.icon).appendTo(item.element);
    }
    disc.current = label;
    disc.currentIndex = this._currentPosition;
  }
});
disc.flow.inactiveOpacity = 0.35;
/* ------------------------------------------------
 * メソッド
 */
disc.showDetail = function () { 
  var item = this.flow.getActiveItem().element;
  var label = $(item).attr('label');
  $(this.flow.Container).animate({
    'left': -($(item).width() / 2) + 'px'}, normal_speed, function () {
      $(disc.flow.items).each(function () {
        if (this.element !== item) $(this.element).fadeTo(fast_speed, disc.flow.inactiveOpacity);
      });
      delete disc.flow.onclickActiveItem;
      var w = $('.content', item).css('width');
      $(disc.player.icon).css({'width': w}).appendTo(item);
      disc.details.show(function () {
        $(disc.container).addClass('active');
      });
    });
  this.isShowDetail = true;
};
disc.hideDetail = function () {
  $(disc.player.icon).css({'width': 0});
  var item = this.flow.getActiveItem().element;
  this.details.hide(function () {
    $(disc.flow.Container).animate({'left': 0}, normal_speed, function () {
      $(disc.flow.items).each(function () { $(this.element).fadeTo(fast_speed, 1); });
      disc.flow.onclickActiveItem = disc.showDetail;
      $(disc.container).removeClass('active');
    });
  });
  this.isShowDetail = false;
};
disc.init = function () {
  this.container = $('#disc')[0];
  this.details.init();
  this.player.init();
};

